import re

def mediane(donnees):
	donnees = sorted(donnees)
	if (len(donnees) % 2 == 0) :
		Q1 = donnees[(len(donnees)/4)]
		MEDIANE = donnees[(len(donnees)/2)]
		Q3 = donnees[(len(donnees)*3/4)]
	else :
		Q1 = (donnees[len(donnees)/4] + donnees[(len(donnees)/4)+1])/2
		MEDIANE = (donnees[len(donnees)/2] + donnees[(len(donnees)/2)+1])/2
		Q3 = (donnees[len(donnees)*3/4] + donnees[(len(donnees)*3/4)+1])/2
	return Q1, MEDIANE,Q3


def cmpval(x,y):
	if x[1]<y[1]:
		return -1
	elif x[1]==y[1]:
		return 0
	else:
		return 1

